import Employee from './components/Employee.js'

function App() {
  return (
    <div className="App">
     const showEmployees = false;

     {showEmployees ?
      <div>
        <Employee></Employee>
        <Employee></Employee>
      </div>     
    :
      <p>No Employee information</p>
    }
    </div>
  );
}

export default App;
